const Sidebar = ({title}) =>{
  const titleList = () => title.map((ttl,i)=>{
    return <li >{ttl}</li>
  });
  return(
    <aside className="sidebar" id="sidebar">
      <ul className="taskList">
        {titleList()}
        <li>a</li>
      </ul>
    </aside>
  )
}

export default Sidebar;
